import React from 'react'
import './NavBar.css'
function Navbar() {
  return (
    <div className='navbar'>
        <img className='avatar' src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg" alt="Loading..." />
        <img className='Logo' src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png" alt="Loading...." />
    </div>
  )
}

export default Navbar
